import React, { useState } from 'react';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';
import './App.css'; // Assuming your CSS is in this file

function CustomNavbar() {
  const [showDropdown, setShowDropdown] = useState({});

  const handleMouseEnter = (dropdown) => {
    setShowDropdown({ ...showDropdown, [dropdown]: true });
  };

  const handleMouseLeave = (dropdown) => {
    setShowDropdown({ ...showDropdown, [dropdown]: false });
  };

  return (
    <Navbar expand="lg" bg="light" variant="light">
      <Container>
        <Navbar.Brand href="#home">QUEST | Nawabshah</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
  <Nav className="me-auto">
    <Nav.Link href="#home">Home</Nav.Link>

    {/* Your custom dropdown */}
    <li className="nav-item dropdown">
      <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
        Dropdown
      </a>
      <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
        <li><a className="dropdown-item" href="#">Action</a></li>
        {/* Other dropdown items */}
      </ul>
    </li>

    {/* Other NavDropdowns here */}
  </Nav>
</Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
